import React from 'react';
import { Link } from 'react-router-dom';
import './LandingPage.css';

const LandingPage = () => {
  return (
    <div className="landing-page">
      <nav className="navbar">
        <h1>Movie Ticket Booking App</h1>
        <ul className="nav-links">
          <li>
            <Link to="/movies" className="nav-link">View Movies</Link>
          </li>
          <li>
            <Link to="/events" className="nav-link">View Events</Link>
          </li>
        </ul>
      </nav>
      <header className="header">
        <h2>Welcome to our Movie Ticket Booking App!</h2>
      </header>
      <section className="about-us">
        <h3>About Us</h3>
        <p>
          Welcome to our Movie Ticket Booking App! We provide an easy and convenient way for you to book tickets for the latest movies and events in town. Enjoy seamless ticket booking experience with our user-friendly platform. Stay tuned for more exciting updates!
        </p>
      </section>
    </div>
  );
};

export default LandingPage;
